if(window["Sentry"]){Sentry.onLoad(function(){const devSite=location.hostname==="localhost"||location.hostname==="woo.peachpay.app";Sentry.init({environment:devSite?"development":"production",debug:true,beforeSend:function(event){try{const exceptions=event.exception.values;for(let i=exceptions.length-1;i>=0;i--){if(exceptions[i].stacktrace&&exceptions[i].stacktrace.frames&&Array.isArray(exceptions[i].stacktrace.frames)&&exceptions[i].stacktrace.frames.length>0){const frame=exceptions[i].stacktrace.frames[0];if(frame.filename&&frame.filename.indexOf("peachpay-for-woocommerce")>=0){continue}}exceptions.splice(i,1)}if(exceptions.length===0){return null}return event}catch(_){return event}}})})}function captureSentryException(error,extra,fingerprint){try{if(window["Sentry"]){return}Sentry.withScope(scope=>{if(extra){try{Object.entries(extra).map(([key,value])=>scope.setExtra(key,value))}catch{}}if(fingerprint){try{scope.setFingerprint(fingerprint)}catch{}}Sentry.captureException(error)})}catch{}}